import { Component, OnInit } from '@angular/core';
import * as mojs from '@mojs/core';

@Component({
  selector: 'loadingpage-sample-load01',
  templateUrl: './load01.component.html',
  styleUrls: ['./load01.component.scss']
})
export class Load01Component implements OnInit {
  constructor() {}

  ngOnInit(): void {
    const timeline = new mojs.Timeline({});

    mojs.addShape('motivation', StringMotivation);
    mojs.addShape('strength', StringStrength);
    mojs.addShape('freetime', StringFreeTime);

    timeline.add(
      this.generateStringFreetime(),
      this.splitLineTop(),
      this.loadBarTop(),
      this.loadStepTop()
    );
    timeline.add(
      this.generateStringMotivation(),
      this.splitLineMiddle(),
      this.loadBarMiddle(),
      this.loadStepMiddle()
    );
    timeline.add(
      this.generateStringStrength(),
      this.splitLineBottom(),
      this.loadBarBottom(),
      this.loadStepBottom()
    );

    timeline.play();
  }

  loadBarTop() {
    return new mojs.Shape({
      parent: '.root-animation',
      className: 'loadBarTop',
      shape: 'rect',
      fill: 'none',
      stroke: 'white',
      isShowStart: false,
      strokeWidth: 3,
      radiusX: 153,
      radiusY: 30,
      x: 50,
      y: -100
    });
  }

  loadBarMiddle() {
    return new mojs.Shape({
      parent: '.root-animation',
      className: 'loadBarMiddle',
      shape: 'rect',
      fill: 'none',
      stroke: 'white',
      isShowStart: false,
      strokeWidth: 3,
      radiusX: 153,
      radiusY: 30,
      x: 50,
      y: 0
    });
  }

  loadBarBottom() {
    return new mojs.Shape({
      parent: '.root-animation',
      className: 'loadBarBottom',
      shape: 'rect',
      fill: 'none',
      stroke: 'white',
      isShowStart: false,
      strokeWidth: 3,
      radiusX: 153,
      radiusY: 30,
      x: 50,
      y: 100
    });
  }

  loadStepTop() {
    const STAGGER = mojs.stagger(mojs.Shape);
    return new STAGGER({
      parent: '.loadBarTop',
      quantifier: 10,
      shape: 'rect',
      points: 3,
      fill: 'white',
      stroke: 'white',
      isShowStart: false,
      strokeWidth: 0,
      scaleX: 0.25,
      scaleY: 0.5,
      duration: 500,
      delay: 'stagger(100)',
      left: 'stagger(20, 30)'
    });
  }

  loadStepMiddle() {
    const STAGGER = mojs.stagger(mojs.Shape);
    return new STAGGER({
      parent: '.loadBarMiddle',
      quantifier: 10,
      shape: 'rect',
      points: 3,
      fill: 'white',
      stroke: 'white',
      isShowStart: false,
      strokeWidth: 0,
      scaleX: 0.25,
      scaleY: 0.5,
      duration: 500,
      delay: 'stagger(100)',
      left: 'stagger(20, 30)'
    });
  }

  loadStepBottom() {
    const STAGGER = mojs.stagger(mojs.Shape);
    return new STAGGER({
      parent: '.loadBarBottom',
      quantifier: 10,
      shape: 'rect',
      points: 3,
      fill: 'white',
      stroke: 'white',
      isShowStart: false,
      strokeWidth: 0,
      scaleX: 0.25,
      scaleY: 0.5,
      duration: 500,
      delay: 'stagger(100)',
      left: 'stagger(20, 30)'
    });
  }

  generateStringFreetime() {
    return new mojs.Shape({
      parent: '.root-animation',
      shape: 'freetime',
      isShowStart: false,
      fill: 'white',
      scaleX: 2,
      scaleY: 2,
      x: -250,
      y: -10
    });
  }

  generateStringMotivation() {
    return new mojs.Shape({
      parent: '.root-animation',
      shape: 'motivation',
      isShowStart: false,
      fill: 'white',
      scaleX: 2,
      scaleY: 2,
      x: -250,
      y: 90
    });
  }

  generateStringStrength() {
    return new mojs.Shape({
      parent: '.root-animation',
      shape: 'strength',
      isShowStart: false,
      fill: 'white',
      scaleX: 2,
      scaleY: 2,
      x: -250,
      y: 190
    });
  }

  splitLineTop() {
    return new mojs.Shape({
      parent: '.root-animation',
      shape: 'line',
      isShowStart: false,
      stroke: 'white',
      angle: 90,
      scaleX: 0.8,
      scaleY: 1,
      x: -150,
      y: -100
    });
  }

  splitLineMiddle() {
    return new mojs.Shape({
      parent: '.root-animation',
      shape: 'line',
      isShowStart: false,
      stroke: 'white',
      angle: 90,
      scaleX: 0.8,
      scaleY: 1,
      x: -150,
      y: 0
    });
  }

  splitLineBottom() {
    return new mojs.Shape({
      parent: '.root-animation',
      shape: 'line',
      isShowStart: false,
      stroke: 'white',
      angle: 90,
      scaleX: 0.8,
      scaleY: 1,
      x: -150,
      y: 100
    });
  }
}

